import React from 'react'
import {Links} from 'react-router-dom'

const Navbar = () => {
    return (
        <nav className="nav-wrapper grey darken-3">
            <div className="container">
                <Link to='/' className="braand-logo">MarioPlan</Link>
            </div>
        </nav>
    )
}
export default Navbar
